import "../App.css";
import { Route, Routes, useNavigate } from 'react-router-dom';
import ListBooks from "./ListBooks";
import Search from "./Search";

function App() {

  return (

    <Routes>
      <Route exact path="/"
        element={<ListBooks />}
      />
      <Route path="/Search"
        element={<Search />}
      />
    </Routes>

  );
}

export default App;
